window.bookSummaryJSON = "<p>The eighth novel of the internationally acclaimed Chaos Seeds saga.</p> <p>A mesmerizing tale reminiscent of the brutality of Goblin Slayer and the majesty of <i>Game of Thrones</i>.</p> <p>Audible's Customer Favorite of the Year!&nbsp;</p> <p>Number one audiobook 2017.</p> <p><b>Welcome my friends!&nbsp;</b></p> <p><b>Welcome...to â€œThe Land\"!</b></p> <p>The battle of the dead was won, but at a great cost. Sion, leader of the Mist Village, was left with only pain and regret as Richter was claimed by the abyss.&nbsp;</p> <p>What no one but the abandoned chaos seed knows is that he narrowly avoided the curse of the lich Singh, a curse that still hangs above his head. Now, surrounded by miles of darkness and tons of crushing rock, Richter has to find his way back into the light.&nbsp;</p> <p>The only problem is that this monster of a man is being pursued by monsters, a demon, and his own foolish choices. Faced with all the dangers of the deep dark, what will Richter say when the buried horrors of The Land come a calling and asked if he's paid his dues?&nbsp;</p> <p>Well he'll look right back, stare that horror in the eye, and say, \"Yes sir, the check is in the mail!\"&nbsp;</p> <p>Welcome back my friends! Welcome back...to The Land!&nbsp;</p> <p>PS - Gnomes still rule!</p> <p>Please like Aleron on FB. He also does almost weekly giveaways of shirts, signed books, and other loot! Facebook author page: facebook.com/LitRPGbooks&nbsp;&nbsp;</p> <p>Also, please contact Aleron. He loves hearing from people! This is his contact info:&nbsp;&nbsp;</p> <p>Website: LitRPG.com&nbsp;<br> Email: Richter@LitRPG.com&nbsp;<br> Instagram and Twitter: @LitRPGBooks&nbsp;<br> Amazon author page: amazon.com/author/www.litrpg.com&nbsp;<br> Patreon: patreon.com/AleronKong&nbsp;<br> Forum: forum.litrpg.com&nbsp;<br> Newsletter: litrpg.com/newsletter&nbsp;<br> Blog: litrpg.com/litrpgblog/&nbsp;<br> YouTube: youtube.com/c/LitRPG</p>"; 
